import Button from 'component-library-bcgov/Button';

const Buttons = ({ size }) => (
  <>
    <Button variant="primary" size={size}>
      Primary
    </Button>
    &nbsp;
    <Button variant="primary-disabled" size={size} disabled>
      Primary Disabled
    </Button>
    &nbsp;
    <Button variant="secondary" size={size}>
      Secondary
    </Button>
    &nbsp;
    <Button variant="secondary-disabled" size={size} disabled>
      Primary Disabled
    </Button>
  </>
);

export default function ButtonPage() {
  return (
    <>
      <div
        style={{
          padding: '15px',
        }}
      >
        <Button variant="primary">Primary</Button>&nbsp;
        <Button variant="primary-disabled" disabled>
          Primary Disabled
        </Button>
        &nbsp;
        <Button variant="secondary">Secondary</Button>&nbsp;
        <Button variant="secondary-disabled" disabled>
          Primary Disabled
        </Button>
        <br />
      </div>
      <div
        style={{
          backgroundColor: '#003366',
          padding: '15px',
        }}
      >
        <Button variant="primary-inverse">Primary Inverse</Button>&nbsp;
        <Button variant="secondary-inverse">Secondary Inverse</Button>
      </div>
    </>
  );
}
